import React from "react";

import Header from "../../components/header";

const Data = {
  title: "Privacy and Cookies Statement",
};

function Privacy({ Data }) {
  return (
    <>
      <Header></Header>
      <div className="page app-container">
        <div className="page-title"></div>
      </div>
    </>
  );
}

export default Privacy;
